import React from 'react';
import { View, Text, Button, Pressable } from 'react-native';
import { useNavigation } from '@react-navigation/native';

const HomeComp = () => {
  const navigation = useNavigation();

  return (
    <View>
      <Text>Home Component</Text>
      <Pressable title="Go to Details" onPress={() => navigation.navigate('Details')}><Text>Go to Details</Text></Pressable>
      <Pressable title="Go to Page3" onPress={() => navigation.navigate('Page3')} />
      <Pressable title="Go to Page4" onPress={() => navigation.navigate('Page4')} />
    </View>
  );
}

export default HomeComp;
